import React from 'react';
import { Routes, Route } from 'react-router-dom';
import Provider from './Context/Provider';
import {
  MainPage
} from "./Pages/Index";
import './CSS/main.css';

function App() {
  return (
    <Provider>
    <Routes>
        <Route exacly path="/" element={ <MainPage /> } />
      </Routes>
    </Provider>
  );
}

export default App;
